    false,nt"url": null,nt"notes": "This dataset has surface Active Currents
    data from NOAA NOS Center fornOperational Oceanographic Products and Services (CO-OPS).nnWARNING:
    These raw data have not been subjected to the National Ocean Servicesn(NOS) Quality
    Control procedures, and do not necessarily meet the criteria andnstandards of official
    NOS data. They are released for limited public use withnappropriate caution.nnWARNING:n*
    Queries for data MUST include stationID= and time>=.n* Queries USUALLY include time<=
    (the default end time corresponds to 'now').n* Queries MUST be for less than 30
    days worth of data.n* The data source isn't completely reliable. If your request
    returns no datan  when you think it should:n  * Try revising the request (e.g.,
    a different time range).n  * The list of stations offering this data may be incorrect.n
